  false,\n\t\"url\": null,\n\t\"notes\": \"This proposal calls for the opening of
  Mathews Brake NWR to sport fishing. General regulations pertaining to licenses,
  creel limits, and methods of taking fish will follow those of the Mississippi Bureau
  of Fisheries and Wildlife published annually. All refuge waters will be open to
  sport fishing within the framework established by the state. The physiography of
  refuge waters is not conducive to commercial fishing at this time. All refuge regulations
  covered under Title 50 Code of Federal Regulations that relate to fishing (i.e.,
  camping, littering, etc.) will apply.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
